【サイズ】約16×11．5×9．5cm <br>
【容量】700ml<br>
【材質】琺瑯 （スチール0．5mm)<br>
セルビア共和国製<br>
表面が滑らかで美しく、発色の良いイギリスブランドの琺瑯「dexam（デクサム）」シリーズ。 <br>
内側にメモリがついた琺瑯製のメジャーカップです。<br>
少しレトロで丸みを帯びたかわいいフォルム。<br>
高温にも耐えることができます。また、食材の臭いが付きづらく、バクテリアの浸食も防ぎ、洗うのも簡単です。<br><br>
※内側の目盛りはおおよその目安としてご使用下さいませ。<br><br>


【ご確認事項】<br>
※一つ一つ手作りです。厚み・重さ・サイズ・色に差が出る事がございます。  <br>
※フチ部分や持ち手部分は特に釉薬がかかりづらい為ハゲがある場合がございます。<br>
※色抜け・白飛び・色ムラがございます。<br>
※加工段階での多少の磨きキズや凹み・折り曲げ加工の微細なズレ・歪み・汚れがある場合もございます。<br>
メーカーより“良品”として販売されております。ハンドメイド製品をご理解いただきご注文をお願い致します。<br> 

<br><hr><br>
※イメージ写真の商品はセットではありません。<br>
<br>
※実際のお色と多少異なる事があります。<br>
<br>
区分：バラエティ<br><br>
エトワール<br><br>


