字が大きく、また、平らな側面に印字されていますので、<br>とっても目盛りが読みやすいメジャーカップです。<br>
目盛りまわりが半透明なので、おしょうゆなど色の濃いものも、<br>計量しやすくなっています。<br>
清潔に吊るしておける「逆さ吊り」フック穴付き。<br>
砂糖300gまでと、小麦粉250gまでの目盛りも付いています。<br>
<br>
